import React  from "react";
import styled        from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import {resturantMenueData} from "../../Data/ResturantMenueData.js";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { Button } from "../../Components/Button.js";



const CardWrapper =styled.div`
  padding-top: 20%;
  padding-left: 20%;
  background-color: darkgray;
`;
const ButtonWrapper=styled.div`
padding-left: 30px;
`;

const MenueSlider = () => {
    var settings = {
        dots            : false,
        infinite        : true,
        speed           : 500,
        slidesToShow    : 3,
        slidesToScroll  : 3
    };
    return (
            <Slider {...settings}>
                    {resturantMenueData.map((items,index) => (
                         <CardWrapper>
                        <div class = "card" style={{width: '18rem'}}>
                            <img src = {items.image} class="card-img-top" alt="..." height="200px"/>
                            <div class = "card-body">
                            <h5 class  = "card-title">{items.title}</h5>
                            <p class   = "card-text">{items.Range}</p>
                            <ButtonWrapper>
                            <Button to = '/checkMenue' primary = 'true'>Check Menue</Button>
                            </ButtonWrapper>
                            </div>
                        </div>
                         </CardWrapper>
                    ))}
                   
            </Slider>
            );
}

export default MenueSlider
